import React from "react";
// react plugin for creating charts
import ChartistGraph from "react-chartist";
// @material-ui/core
import { makeStyles } from "@material-ui/core/styles";
import Icon from "@material-ui/core/Icon";
// @material-ui/icons
import Store from "@material-ui/icons/Store";
import Warning from "@material-ui/icons/Warning";
import DateRange from "@material-ui/icons/DateRange";
import LocalOffer from "@material-ui/icons/LocalOffer";
import Update from "@material-ui/icons/Update";
import ArrowUpward from "@material-ui/icons/ArrowUpward";
import AccessTime from "@material-ui/icons/AccessTime";
import Accessibility from "@material-ui/icons/Accessibility";
import BugReport from "@material-ui/icons/BugReport";
import Code from "@material-ui/icons/Code";
import Cloud from "@material-ui/icons/Cloud";
// core components
import GridItem from "components/Grid/GridItem.js";
import GridContainer from "components/Grid/GridContainer.js";
import Table from "components/Table/Table.js";
import Tasks from "components/Tasks/Tasks.js";
import CustomTabs from "components/CustomTabs/CustomTabs.js";
import Danger from "components/Typography/Danger.js";
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardIcon from "components/Card/CardIcon.js";
import CardBody from "components/Card/CardBody.js";
import CardFooter from "components/Card/CardFooter.js";

import firebase from "firebase/app";
import "firebase/database";
import { db_config } from "config";

import { bugs, website, server } from "variables/general.js";

import {
  allMetrics,
  lightlevels1,
  humiditylevels1,
  ph1,
  lightlevels2,
  humiditylevels2,
  waterlevels2,
  lightlevels3,
  humiditylevels3,
  waterlevels3,
} from "variables/charts.js";

import styles from "assets/jss/material-dashboard-react/views/dashboardStyle.js";

const useStyles = makeStyles(styles);

export default function Dashboard() {
  const classes = useStyles();
  var a = [1, 10, 100, 1000, 10000];
  console.log("Allmetrics")
  console.log(allMetrics);
  return (
    <div>

      <GridContainer>
        {a.map(i => {
          console.log(i);
          // return <GridItem xs={12} sm={12} md={4}>
          //   <Card chart>
          //     <CardHeader color="info">
          //       <ChartistGraph
          //         className="ct-chart"
          //         data={allMetrics[i].data}
          //         type="Line"
          //         options={allMetrics[i].options}
          //         listener={allMetrics[i].animation}
          //       />
          //     </CardHeader>
          //     <CardBody>
          //       <h4 className={classes.cardTitle}>allMetrics[i].title</h4>
          //     </CardBody>
          //   </Card>
          // </GridItem>;
          return <li>{i}</li>;
        })}
      </GridContainer>

      <GridContainer>
        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="info">
              <ChartistGraph
                className="ct-chart"
                data={lightlevels1.data}
                type="Line"
                options={lightlevels1.options}
                listener={lightlevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Light (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="rose">
              <ChartistGraph
                className="ct-chart"
                data={humiditylevels1.data}
                type="Line"
                options={humiditylevels1.options}
                responsiveOptions={humiditylevels1.responsiveOptions}
                listener={humiditylevels1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 Humidity (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="success">
              <ChartistGraph
                className="ct-chart"
                data={ph1.data}
                type="Line"
                options={ph1.options}
                listener={ph1.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 1 PH Level</h4>
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>


      <GridContainer>
        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="info">
              <ChartistGraph
                className="ct-chart"
                data={lightlevels2.data}
                type="Line"
                options={lightlevels2.options}
                listener={lightlevels2.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 2 Light (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="rose">
              <ChartistGraph
                className="ct-chart"
                data={humiditylevels2.data}
                type="Line"
                options={humiditylevels2.options}
                responsiveOptions={humiditylevels2.responsiveOptions}
                listener={humiditylevels2.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 2 Humidity (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="success">
              <ChartistGraph
                className="ct-chart"
                data={waterlevels2.data}
                type="Line"
                options={waterlevels2.options}
                listener={waterlevels2.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 2 Water Level</h4>
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>


      <GridContainer>
        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="info">
              <ChartistGraph
                className="ct-chart"
                data={lightlevels3.data}
                type="Line"
                options={lightlevels3.options}
                listener={lightlevels3.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 3 Light (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="rose">
              <ChartistGraph
                className="ct-chart"
                data={humiditylevels3.data}
                type="Line"
                options={humiditylevels3.options}
                responsiveOptions={humiditylevels3.responsiveOptions}
                listener={humiditylevels3.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 3 Humidity (%)</h4>
            </CardBody>
          </Card>
        </GridItem>



        <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="success">
              <ChartistGraph
                className="ct-chart"
                data={waterlevels3.data}
                type="Line"
                options={waterlevels3.options}
                listener={waterlevels3.animation}
              />
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>System 3 Water Level</h4>
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>


    </div>
  );
}
